records.addlTxt:
State files an Amended Information charging 2 cts. Possess THC, contrary to Section 961.41(3g)(e) of the Wisconsin Statutes and 1 ct. PTC Possess Drug Paraphernalia, contrary to Section 961.573(1) & 939.05 of the Wisconsin Statutes.   
No contest pleas to the charges.   Convicted.   Sentences are withheld.   Defendan tis placed on probation to DOC for two (2) years.   Conditions of probation are:
1) On Count 1 only - Thirty (30) days jail, under the Huber Law, to commence on 09-03-15 by 6:00 p.m.   Transfer to Sheboygan County Jail is authorized.   
2) AODA assessment and follow through;
3) Submit to random urine screens and pay for same;
4) Assessment/treatment/counseling as deemed appropriate by the Department's assessment process;
5) Maintain absolute sobriety;
6) Full-time work/schooling combination;
7) Pay costs of action;
8) Pay supervision fees in an amount to be determined by DOC.  
Plea Questionnaire/Waiver of Rights.   
Minutes.
